"485296":{"id":"485296","name":"RedBad: A Invasão dos Francos","slug":"redbad-a-invasao-dos-francos","original_title":"Redbad","overview":"Redbad, filho do rei Aldigsl, está duvidando dos rituais ultrapassados de seu povo, os frísios. Ele entra em conflito com o pai quando sua namorada, Fenne, é indicada para ser sacrificada aos deuses. Durante o ritual de sacrifício, os francos entram na cidade. Na batalha, a cidade de Dorestad é capturada e o ambicioso Eibert, tio de Redbad, toma o poder e culpa o sobrinho pela derrota. Amarrado a uma jangada, Redbad é lançado ao mar, mas sobrevive e chega à costa, sendo resgatado pelos vikings. Para libertar seu povo, Redbad conta com a ajuda dos vikings. Mas seriam eles fortes o bastante?","first_air_date":"2018-06-28","runtime":160,"episode_run_time":[160],"vote_average":6.3,"created_by":["Bulletproof Cupid","Farmhouse Film & TV B.V.","Rebel Entertainment"],"production_companies":[{"name":"Bulletproof Cupid"},{"name":"Farmhouse Film & TV B.V."},{"name":"Rebel Entertainment"}],"cast":["Gijs Naber","Jonathan Banks","Lisa Smit","Søren Malling","Derek de Lint"],"backdrop_path":"https://image.tmdb.org/t/p/original/fQgSMbHVREjf1mop0m9ZEa5DdBs.jpg","poster_path":"https://image.tmdb.org/t/p/original/qEtW1ldSynOwgPXesghxS7ntSXA.jpg","certification":"N/A","genres":["Aventura","História","Guerra","Drama"],"trailer":"v_SoXIUE8Ok"},
