"34152":{"id":"34152","name":"Crooklyn - Uma Família de Pernas pro Ar","slug":"crooklyn-uma-familia-de-pernas-pro-ar","original_title":"Crooklyn","overview":"Nova York, anos 70. Era o tempo dos Jackson 5, da família Dó-Ré-Mi e do Black Power. Neste cenário musical efervescente, Spike Lee nos traz a vibrante história da professora Carolyn Carmichael (Alfre Woodard), uma mãe carinhosa e preocupada, seu marido Woody (Delroy Lindo), músico de Jazz, e seus cinco filhos vivendo no agitado bairro do Brooklyn. Quando Woody, que já foi bem sucedido com a música, perde seu emprego uma crise começa a envolver sua família e seu casamento. E agora todos terão de confiar uns nos outros - e também no senso de humor de cada um - para enfrentar as grandes alegrias e inevitáveis tristezas do dia-dia.","first_air_date":"1994-05-13","runtime":114,"episode_run_time":[114],"vote_average":6.8,"created_by":["40 Acres and a Mule Filmworks","Universal Pictures","Child Hood Productions"],"production_companies":[{"name":"40 Acres and a Mule Filmworks"},{"name":"Universal Pictures"},{"name":"Child Hood Productions"}],"cast":["Alfre Woodard","Delroy Lindo","David Patrick Kelly","Zelda Harris","Carlton Williams"],"backdrop_path":"https://image.tmdb.org/t/p/original/mIKuvEhBvDf9LGxE9x6m0hDR9Au.jpg","poster_path":"https://image.tmdb.org/t/p/original/iFqe07F78SO0SIBzWcK4I5MwNvP.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
