"332704":{"id":"332704","name":"Visões do Passado","slug":"visoes-do-passado","original_title":"Backtrack","overview":"O psicólogo Peter Bower e sua esposa decidem retornar a Melbourne, na Austrália, lugar onde se conheceram, para tentar começar uma vida nova e deixar o evento traumático que marcou suas vidas para sempre no passado: a morte de sua filha de 12 anos em um trágico acidente. Uma vez instalados na cidade, Bower recebe a ajuda do Dr. Duncan, que realiza uma triagem de pacientes e os encaminha para o consultório do psicólogo como uma forma de Bower retornar ao trabalho mais facilmente. Quando tudo parecia se acertar, quando a vida parecia voltar aos trilhos, Bower descobre um terrível elo entre alguns de seus pacientes que o obriga a retornar a sua cidade natal e a confrontar um dilema que só ele pode solucionar.","first_air_date":"2015-07-25","runtime":90,"episode_run_time":[90],"vote_average":5.8,"created_by":["Head Gear Films","Screen Australia","Metrol Technology","Bankside Films"],"production_companies":[{"name":"Head Gear Films"},{"name":"Screen Australia"},{"name":"Metrol Technology"},{"name":"Bankside Films"}],"cast":["Adrien Brody","Sam Neill","Malcolm Kennard","Chloe Bayliss","Bruce Spence"],"backdrop_path":"https://image.tmdb.org/t/p/original/yr9UxlMes1AzYUxscoPo7dSmiTv.jpg","poster_path":"https://image.tmdb.org/t/p/original/kl1jbDAVwjE2vgI8qS5lGOh46xK.jpg","certification":"N/A","genres":["Mistério","Terror","Thriller"],"trailer":"N/A"},
