"1546":{"id":"1546","name":"Impulsividade","slug":"impulsividade","original_title":"Thumbsucker","overview":"Justin Cobb (Lou Taylor Pucci) seria um adolescente comum se não fosse o fato de que nunca conseguiu parar de chupar o dedo. Aos 17 anos, após ter tentado de tudo para se livrar do vício, ele finalmente resolve o problema através da hipnose feita pelo seu dentista, que tem ambições a psicólogo. O verdadeiro problema, porém, está apenas começando. Justin continua compensando suas frustrações pela boca, consumindo todo e qualquer tipo de droga, de maconha a remédios antidepressivos. Filho de pais que nunca saíram da adolescência, ele vai ter de aprender a crescer sozinho, nem que seja à força.","first_air_date":"2005-09-16","runtime":96,"episode_run_time":[96],"vote_average":6.2,"created_by":["This is that","Cinema-Go-Go","Bull's Eye Entertainment","Bob Yari Productions"],"production_companies":[{"name":"This is that"},{"name":"Cinema-Go-Go"},{"name":"Bull's Eye Entertainment"},{"name":"Bob Yari Productions"}],"cast":["Lou Taylor Pucci","Tilda Swinton","Vincent D'Onofrio","Keanu Reeves","Benjamin Bratt"],"backdrop_path":"https://image.tmdb.org/t/p/original/uTh7Uyy5sdGmcl2AgqJoHlxP3PE.jpg","poster_path":"https://image.tmdb.org/t/p/original/AsiIGHQ7ZQm9mmNydBEV7T3wCRU.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
