"282984":{"id":"282984","name":"O Homem Irracional","slug":"o-homem-irracional","original_title":"Irrational Man","overview":"Em crise existencial, o professor de filosofia Abe Lucas (Joaquin Phoenix) chega para lecionar em uma pequena cidade dos Estados Unidos. Logo uma de suas alunas, Jill (Emma Stone), se aproxima dele devido ao fascínio que sente pelo seu intelecto, além da tristeza que sempre carrega consigo. Simultaneamente, ele é alvo de Rita (Parker Posey), uma professora casada que tenta ter um caso com ele. A vida começa a melhorar para Abe quando, numa ida à lanchonete com Jill, ouve a conversa de uma desconhecida sobre a perda da guarda do filho devido à uma decisão do juiz Spangler (Tom Kemp). Abe logo começa a idealizar o assassinato de Spangler e como, por ser um completo desconhecido, jamais seria descoberto.","first_air_date":"2015-07-17","runtime":95,"episode_run_time":[95],"vote_average":6.5,"created_by":["Perdido Productions","Gravier Productions"],"production_companies":[{"name":"Perdido Productions"},{"name":"Gravier Productions"}],"cast":["Joaquin Phoenix","Emma Stone","Jamie Blackley","Parker Posey","Joe Stapleton"],"backdrop_path":"https://image.tmdb.org/t/p/original/7KxcJLsqyp8I03eVZml1XvonVYz.jpg","poster_path":"https://image.tmdb.org/t/p/original/2A8uP2ScldXbWnJqf6eaU4akVUl.jpg","certification":"14 Anos","genres":["Drama","Comédia"],"trailer":"N/A"},
