"412766":{"id":"412766","name":"A Deusa da Vingança","slug":"a-deusa-da-vinganca","original_title":"Sam Was Here","overview":"Sam, um vendedor ambulante, viaja pelo deserto em busca de clientes, mas a área parece deserta. E sua esposa não atende suas chamadas telefônicas. É como se todos estivessem evitando ele. Seu único contato com o mundo exterior é uma estação de rádio local. O anfitrião, um homem estranho com o nome de Eddy, atende chamadas a respeito de um assassino de crianças, e empurra os ouvintes para caçar o homem até a morte. É quando Sam percebe que todos pensam que ele é o assassino.","first_air_date":"2016-09-27","runtime":75,"episode_run_time":[75],"vote_average":5.4,"created_by":["Nightcall Productions","KuroKitsu","Vixens","Firm Studio","Benzene Music"],"production_companies":[{"name":"Nightcall Productions"},{"name":"KuroKitsu"},{"name":"Vixens"},{"name":"Firm Studio"},{"name":"Benzene Music"}],"cast":["Rusty Joiner","Sigrid La Chapelle","Rhoda Pell","Hassan Galedary","Clément Lepoutre"],"backdrop_path":"https://image.tmdb.org/t/p/original/vPlSNGV0JNraoABIvL6dFvmrwQg.jpg","poster_path":"https://image.tmdb.org/t/p/original/pWFo72g7YIcc5ADZT9b6LzP6T6K.jpg","certification":"18","genres":["Terror","Mistério","Thriller"],"trailer":"N/A"},
