"45153":{"id":"45153","name":"Amores Divididos","slug":"amores-divididos","original_title":"Eve's Bayou","overview":"A estória desenrola-se na Louisiana, no ano de 1962, a família Batiste, capitaneada pelo charmoso médico Dr.Louis (Samuel L.Jackson), que embora seja casado com uma bela esposa, tem uma fraqueza por belas pacientes. Certo dia, quando Dr.Louis está flertando com uma sexy mulher casada, acidentalmente ele é observado por sua filha mais jovem, que acaba se traumatizando com a cena e contando tudo à sua irmã mais velha, que possui um terrível segredo acerca do pai delas.","first_air_date":"1997-11-07","runtime":109,"episode_run_time":[109],"vote_average":6.4,"created_by":["Trimark Pictures","Addis Wechsler Pictures","ChubbCo Film"],"production_companies":[{"name":"Trimark Pictures"},{"name":"Addis Wechsler Pictures"},{"name":"ChubbCo Film"}],"cast":["Jurnee Smollett","Meagan Good","Samuel L. Jackson","Lynn Whitfield","Debbi Morgan"],"backdrop_path":"https://image.tmdb.org/t/p/original/dzoLlCiMhraAfCjQuudyVLcl8Le.jpg","poster_path":"https://image.tmdb.org/t/p/original/2PvrxMzUP8nnRVE1jmswRw2JRBU.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"1031774":{"id":"1031774","name":"Thriller 40","slug":"thriller-40","original_title":"Thriller 40","overview":"Documentário dedicado ao álbum mais vendido de todos os tempos, \"Thriller\", de Michael Jackson. Com imagens nunca antes vistas e entrevistas francas, o documentário retrata o momento da carreira de Jackson que o lançou para o megaestrelato.","first_air_date":"2023-12-02","runtime":89,"episode_run_time":[89],"vote_average":8.5,"created_by":["Company Name","Optimum Productions"],"production_companies":[{"name":"Company Name"},{"name":"Optimum Productions"}],"cast":["Michael Jackson","Quincy Jones","Paul McCartney","Usher","Mary J. Blige"],"backdrop_path":"https://image.tmdb.org/t/p/original/3kRQxaFyggjK6LQXrKETrnWksyI.jpg","poster_path":"https://image.tmdb.org/t/p/original/5LOKk1Ca1YaCb3EjTEMDJdPbQxN.jpg","certification":"N/A","genres":["Documentário","Música"],"trailer":"N/A"},
"621753":{"id":"621753","name":"Bikram: Yogi, Guru, Predador","slug":"bikram-yogi-guru-predador","original_title":"Bikram: Yogi, Guru, Predator","overview":"O documentário examina a dramática ascensão e queda do controverso fundador da ioga quente, Bikram Choudhury. Chegando em Beverly Hills, no início dos anos 70, Choudhury rapidamente cultivou sua fama e construiu um império global de fitness que lhe proporcionou extrema riqueza. Mas, na década de 2010, quando surgiram inúmeras alegações de abuso sexual e histórias de seu ambiente de treinamento agressivo, semelhante ao culto, os processos começaram a aumentar e o estilo de ensino pouco ortodoxo de Choudhury tornou-se notícia de primeira página.","first_air_date":"2019-09-10","runtime":86,"episode_run_time":[86],"vote_average":6.3,"created_by":["Pulse Films"],"production_companies":[{"name":"Pulse Films"}],"cast":["Larissa Anderson","Francesca Asumah","Sarah Baughn","Bikram Choudhury","John Dowd"],"backdrop_path":"https://image.tmdb.org/t/p/original/gwksBTz60lVeGWKqDr0n8ij0hfp.jpg","poster_path":"https://image.tmdb.org/t/p/original/8iv4Im2iJCUXbnPDYDQDYhD4JBP.jpg","certification":"N/A","genres":["Documentário","Crime"],"trailer":"N/A"},
"752939":{"id":"752939","name":"Shawn Mendes: In Wonder","slug":"shawn-mendes-in-wonder","original_title":"Shawn Mendes: In Wonder","overview":"O documentário lança um olhar íntimo sobre a vida do cantor Shawn Mendes, retratando os anos mais recentes de sua carreira. As filmagens acompanham Mendes durante sua turnê mundial realizada em 2019, que passou pela América do Norte, América do Sul, Ásia, Europa e Austrália.","first_air_date":"2020-11-23","runtime":83,"episode_run_time":[83],"vote_average":8.2,"created_by":["Universal Music Group","Permanent Wave","Polygram Entertainment","Fulwell 73 Productions"],"production_companies":[{"name":"Universal Music Group"},{"name":"Permanent Wave"},{"name":"Polygram Entertainment"},{"name":"Fulwell 73 Productions"}],"cast":["Shawn Mendes","Camila Cabello"],"backdrop_path":"https://image.tmdb.org/t/p/original/6POBC9eiJBYDfE6bidjrthKB6eC.jpg","poster_path":"https://image.tmdb.org/t/p/original/aSs7V3ryvxCSpcXcxf9NY8YBtGC.jpg","certification":"N/A","genres":["Música","Documentário"],"trailer":"nt-gjtozwIg"},
"374416":{"id":"374416","name":"Funcionário do Mês","slug":"funcionario-do-mes","original_title":"Quo vado?","overview":"Checco é um homem que tem a vida que sempre desejou. Nascido em uma família rica, ele nunca sentiu falta de nada na vida e, já adulto, conseguiu um emprego como funcionário público que lhe demanda muito pouco. No entanto, cortes nos gastos do Governo fazem com que a vida de Checco seja virada de cabeça para baixo quando ele precisa decidir entre abandonar o seu sagrado emprego ou ser transferido para o Pólo Norte.","first_air_date":"2016-01-01","runtime":86,"episode_run_time":[86],"vote_average":6.8,"created_by":["Taodue Film","Mediaset Premium"],"production_companies":[{"name":"Taodue Film"},{"name":"Mediaset Premium"}],"cast":["Checco Zalone","Eleonora Giovanardi","Sonia Bergamasco","Ludovica Modugno","Maurizio Micheli"],"backdrop_path":"https://image.tmdb.org/t/p/original/gCyHTnGrhUQM5jS2PWe7LFU7Npb.jpg","poster_path":"https://image.tmdb.org/t/p/original/9X8csv75uWcVspL3Mk9gSJhBJ0J.jpg","certification":"12","genres":["Comédia"],"trailer":"l104yttPfIw"},
"255692":{"id":"255692","name":"Soldados de Gelo","slug":"soldados-de-gelo","original_title":"Ice Soldiers","overview":"Um cientista descobre os corpos de três russos geneticamente modificados e congelados enterrados no norte do Canadá. Após descongelá-los, ele percebe que desencadeou uma ameaça mortal à sociedade ocidental e deve detê-los a todo custo.","first_air_date":"2013-12-06","runtime":95,"episode_run_time":[95],"vote_average":5.1,"created_by":["Bunk 11 Pictures","TAJJ Media","Hideaway Pictures"],"production_companies":[{"name":"Bunk 11 Pictures"},{"name":"TAJJ Media"},{"name":"Hideaway Pictures"}],"cast":["Dominic Purcell","Adam Beach","Michael Ironside","Gabriel Hogan","Matthew G. Taylor"],"backdrop_path":"https://image.tmdb.org/t/p/original/1z0fo8aHbbT1XcMimEOYgOe9gjx.jpg","poster_path":"https://image.tmdb.org/t/p/original/5wsNxymjvBo65z0g5XqqOodSye2.jpg","certification":"N/A","genres":["Ação","Ficção científica"],"trailer":"N/A"},
"89237":{"id":"89237","name":"A Fita Azul","slug":"a-fita-azul","original_title":"Electrick Children","overview":"A adolescente Raquel vive em uma comunidade mórmon conservadora, no estado de Utah. Aos 15 anos de idade, ela descobre uma fita cassete e ouve pela primeira vez o rock n'roll. Esta experiência incrível transforma sua vida: 3 meses mais tarde, ela aparece grávida, e insiste que a música foi responsável por sua gestação. Quando seus pais tentam casá-la contra sua vontade, ela foge em busca da voz misteriosa da fita cassete.\r Estrelando: Bill Sábio, Billy Zane, Cassidy Gard, Cynthia Watros, John Patrick Amedori, Julia Garner, Liam Aiken, Rory Culkin.","first_air_date":"2012-07-11","runtime":96,"episode_run_time":[96],"vote_average":6.4,"created_by":["Live Wire Films"],"production_companies":[{"name":"Live Wire Films"}],"cast":["Julia Garner","Rory Culkin","Liam Aiken","Bill Sage","Cynthia Watros"],"backdrop_path":"https://image.tmdb.org/t/p/original/wRU4Ec6GHPUGL0ruRBCzI7PJoKk.jpg","poster_path":"https://image.tmdb.org/t/p/original/hidKIsEe4LUzh38XQm3Xjsecj5a.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
