"21210":{"id":"21210","name":"Do Coração","slug":"do-coracao","original_title":"दिल से..","overview":"Segundo a literatura árabe antiga, o amor é classificado em sete diferentes tonalidades: atração, paixão, amor, reverência, adoração, obsessão e morte. Essa é uma viagem através destas sete cores do amor, num belo percurso estético e político através da história de Amarkant Varma, um descendente de militares que viaja pela Índia a serviço de uma rádio de alcance nacional, na tentativa de fazer entrevistas sobre o 50º aniversário da independência indiana. Numa de suas jornadas, apaixona-se por Meghna, uma misteriosa mulher envolvida em atentados terroristas, que o deixa após eles passarem dois dias juntos nas estradas. Com o coração partido, ele concorda em se casar com Preeti, noiva escolhida por sua mãe. O embate entre o amor e a ideologia é retratado nesta história que também se apresenta como melodrama político.","first_air_date":"1998-08-22","runtime":163,"episode_run_time":[163],"vote_average":6.9,"created_by":["RGV Film Factory","Madras Talkies"],"production_companies":[{"name":"RGV Film Factory"},{"name":"Madras Talkies"}],"cast":["शाहरुख़ ख़ान","Manisha Koirala","Preity Zinta","Mita Vashisht","Arundathi Nag"],"backdrop_path":"https://image.tmdb.org/t/p/original/8v8Uc4PfiZk6g87qdq2L87sCDvE.jpg","poster_path":"https://image.tmdb.org/t/p/original/rdnkOPYlHf8WaPRllTz3dsuzpp8.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
