"35284":{"id":"35284","name":"A Batalha de Anzio","slug":"a-batalha-de-anzio","original_title":"Lo sbarco di Anzio","overview":"Um das batalhas mais sangrentas da WW2 com os Aliados rompendo as linhas alemãs que tinham se fechado na cabeça de peaia de Anzio. Quatro meses e 30.000 mortes depois os Aliados finalmente marcham para Roma.\r As Forças Aliadas desembarcam em Anzio sem oposição, mas em vez de avançar em linha reta para o interior seu comandante decide cavar, se entrincheirar. Um correspondente de guerra aguerrido pega emprestado um jipe, vai até Roma e volta sem encontrar quaisquer forças alemãs, mas o seu relatório sobre esta ausência do inimigo é desconsiderado. No momento em que os generais finalmente resolvem fazer algum movimento de avanço os alemães já tinham conseguido montar a sua defesa e uma luta prolongada e sangrenta se inicia.","first_air_date":"1968-07-24","runtime":117,"episode_run_time":[117],"vote_average":5.7,"created_by":["DDL Cinematografica","Columbia Pictures"],"production_companies":[{"name":"DDL Cinematografica"},{"name":"Columbia Pictures"}],"cast":["Robert Mitchum","Peter Falk","Robert Ryan","Arthur Kennedy","Giancarlo Giannini"],"backdrop_path":"https://image.tmdb.org/t/p/original/4zKicMniOnma5jcckeYkMZ2AwsU.jpg","poster_path":"https://image.tmdb.org/t/p/original/qGpxxtPAp79pZR87QUSqlEt5XQG.jpg","certification":"16","genres":["Guerra","Ação","Drama"],"trailer":"N/A"},
