"430365":{"id":"430365","name":"De Braços Abertos","slug":"de-bracos-abertos","original_title":"À bras ouverts","overview":"Um proeminente intelectual francês branco e de esquerda – personagem inspirado em Bernard-Henri Lévy – lança um livro sobre como a sociedade deve ser mais aberta e acolher imigrantes e outras culturas sem preconceitos. A debater o livro na televisão, um oponente de direita desafia-o a fazer isso mesmo: acolher outras culturas na sua própria casa. Ele, a mulher (herdeira de uma fortuna e aspirante a artista) e o filho acolhem assim em casa uma família cigana. O que se segue é uma comédia cheia de confrontos entre as duas culturas, sem muita profundidade quer no tratamento do tema do racismo e da xenofobia, quer nas piadas em si – há até recurso a técnicas antiquadas como \"blackface\".","first_air_date":"2017-04-05","runtime":92,"episode_run_time":[92],"vote_average":5.3,"created_by":["W9","M6 Films","SND","Caméra One","Nexus Factory","Ouille Productions","uMedia","Pulsar Productions","Ciné+","Canal+"],"production_companies":[{"name":"W9"},{"name":"M6 Films"},{"name":"SND"},{"name":"Caméra One"},{"name":"Nexus Factory"},{"name":"Ouille Productions"},{"name":"uMedia"},{"name":"Pulsar Productions"},{"name":"Ciné+"},{"name":"Canal+"}],"cast":["Christian Clavier","Ary Abittan","Elsa Zylberstein","Cyril Lecomte","Nanou Garcia"],"backdrop_path":"https://image.tmdb.org/t/p/original/hnc2ylYr5gPwGPKxjHOm4xcqUhv.jpg","poster_path":"https://image.tmdb.org/t/p/original/xhypRoEHSVtfgR5WlQaLORgiXqe.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
