"9777":{"id":"9777","name":"A Prova","slug":"a-prova","original_title":"Proof","overview":"Catherine (Gwyneth Paltrow) é uma jovem atormentada pelos anos em que esteve cuidando de seu pai, Robert (Anthony Hopkins), um gênio da matemática que sofria de esclerose no fim da vida. Temendo enlouquecer que nem seu pai, Catherine se afasta de todos e vive isolada em sua casa. Na véspera do seu aniversário de 27 anos reaparece em sua vida Claire (Hope Davies), sua irmã, e Hal (Jake Gyllenhaal), um ex-aluno de Robert. Hal deseja pesquisar nos 103 cadernos escritos por Robert em seus anos de esclerose, desejando encontrar algo que possa ter alguma lógica, mas também se interessa por Catherine. Já Claire chega à cidade desejando vender a casa da família e fazer com que Catherine more com ela em Nova York.","first_air_date":"2005-09-05","runtime":99,"episode_run_time":[99],"vote_average":6.3,"created_by":["Miramax","Endgame Entertainment","Hart-Sharp Entertainment"],"production_companies":[{"name":"Miramax"},{"name":"Endgame Entertainment"},{"name":"Hart-Sharp Entertainment"}],"cast":["Gwyneth Paltrow","Anthony Hopkins","Jake Gyllenhaal","Hope Davis","Danny McCarthy"],"backdrop_path":"https://image.tmdb.org/t/p/original/7WW1qhOdDzYWmjmhIwVt8lc9FCJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/hDR3ifQly6j1ZQe7GoBIqMNyJUf.jpg","certification":"N/A","genres":["Drama","Mistério"],"trailer":"N/A"},
