"373451":{"id":"373451","name":"Michael Jackson's Journey from Motown to Off the Wall","slug":"michael-jackson-s-journey-from-motown-to-off-the-wall","original_title":"Michael Jackson's Journey from Motown to Off the Wall","overview":"A história de como Michael Jackson de astro infantil para Rei do Pop, logo após o lançamento de um de seus primeiros e mais importantes álbuns: Off the Wall. Uma análise detalhada da gravação através da montagem de raras imagens de arquivo e entrevistas daqueles que contribuíram na produção do disco e daqueles cujas vidas foram afetadas pelo enorme sucesso e pela grande qualidade da obra de Michael Jackson.","first_air_date":"2016-02-06","runtime":93,"episode_run_time":[93],"vote_average":7.0,"created_by":["40 Acres and a Mule Filmworks"],"production_companies":[{"name":"40 Acres and a Mule Filmworks"}],"cast":["Michael Jackson","Quincy Jones","Rosie Perez","Pharrell Williams","Mark Ronson"],"backdrop_path":"https://image.tmdb.org/t/p/original/pcjHAIyZbw5C79jSE2VWvsx9ish.jpg","poster_path":"https://image.tmdb.org/t/p/original/dJuuKMTG73WR2O14QBo4VgbW4Ei.jpg","certification":"N/A","genres":["Música","Documentário"],"trailer":"N/A"},
"10288":{"id":"10288","name":"Fido - O Mascote","slug":"fido-o-mascote","original_title":"Fido","overview":"Há muitos anos a Terra passou por uma nuvem de poeira espacial, o que fez com que os mortos retornassem com uma insaciável fome por carne humana. A situação é alarmante em todo o planeta, até ser inventada pela ZomCon uma coleira que faz com que os zumbis se tornem dóceis. Graças a esta invenção os zumbis puderam ser jardineiros, leiteiros e até mesmo animais de estimação. A ZomCon quer que todos acreditem que os zumbis estão sob controle, mas Timmy Robinson (K'Sun Ray) não acredita nisto. Desconfiado e isolado, Timmy fica tanto tempo em seu quarto que até seus pais se esquecem dele. Quando sua mãe (Carrie-Anne Moss) compra um zumbi para ajudá-la em casa ele logo passa a vê-lo com desconfiança. Mas, após o zumbi salvá-lo dos garotos que sempre o perseguiam, nasce uma amizade entre eles e Timmy passa a chamá-lo de Fido (Billy Connolly).","first_air_date":"2006-09-07","runtime":92,"episode_run_time":[92],"vote_average":6.4,"created_by":["Lions Gate Films","Astral Media","Anagram Pictures"],"production_companies":[{"name":"Lions Gate Films"},{"name":"Astral Media"},{"name":"Anagram Pictures"}],"cast":["Billy Connolly","Carrie-Anne Moss","Dylan Baker","Kesun Loder","Henry Czerny"],"backdrop_path":"https://image.tmdb.org/t/p/original/bWukUgej8vZTRF9YFi2NWmswZie.jpg","poster_path":"https://image.tmdb.org/t/p/original/gHrJ9SDX9I1ZUyfxmcfgzUFOYWC.jpg","certification":"N/A","genres":["Terror","Comédia","Romance","Drama"],"trailer":"N/A"},
