"584288":{"id":"584288","name":"O Amor de Sylvie","slug":"o-amor-de-sylvie","original_title":"Sylvie's Love","overview":"Sylvie conhece o aspirante a saxofonista Robert quando ele trabalha na loja de discos do pai, no Harlem. Depois que um romance de verão chega ao fim, os dois se reconectam fatalmente vários anos depois e descobrem que seus sentimentos um pelo outro nunca desapareceram.","first_air_date":"2020-01-27","runtime":114,"episode_run_time":[114],"vote_average":6.2,"created_by":["Iam21 Entertainment"],"production_companies":[{"name":"Iam21 Entertainment"}],"cast":["Tessa Thompson","Nnamdi Asomugha","Aja Naomi King","Jemima Kirke","Tone Bell"],"backdrop_path":"https://image.tmdb.org/t/p/original/q5LAvX97FVgzd8YwAGss6waQwJH.jpg","poster_path":"https://image.tmdb.org/t/p/original/qf3ReJWoO721NJ8nj5KioE7fQpP.jpg","certification":"14","genres":["Romance","Drama"],"trailer":"N/A"},
"432615":{"id":"432615","name":"Em Busca dos Corais","slug":"em-busca-dos-corais","original_title":"Chasing Coral","overview":"“Em Busca dos Corais” retrata a determinação de um publicitário, um autoproclamado nerd dos corais, experientes designers de câmeras e renomados biólogos marinhos para inventar a primeira câmera com função time-lapse a registrar o branqueamento dos corais em tempo real. Infelizmente, não é uma tarefa fácil, e a equipe enfrenta problemas técnicos e a força da natureza para atingir seu objetivo e documentar a transformação trágica e irrefutável que acontece abaixo das ondas. Com muito suspense, emoção e uma fotografia espetacular, “Em Busca dos Corais” é uma revelação dramática que deixará o público com os nervos à flor da pele.","first_air_date":"2017-03-16","runtime":93,"episode_run_time":[93],"vote_average":7.7,"created_by":["Sustainable Films","Exposure Labs","Argent Pictures","Code Blue Foundation","EarthSense Foundation","Kendeda Fund, The"],"production_companies":[{"name":"Sustainable Films"},{"name":"Exposure Labs"},{"name":"Argent Pictures"},{"name":"Code Blue Foundation"},{"name":"EarthSense Foundation"},{"name":"Kendeda Fund, The"}],"cast":["Andrew Ackerman","Pim Bongaerts","Neal Cantin","Phil Dustan","Ruth Gates"],"backdrop_path":"https://image.tmdb.org/t/p/original/oY5NWGRHyfJcchaJYZseQpIO7RE.jpg","poster_path":"https://image.tmdb.org/t/p/original/AvRHRqI4ahmEwscylU10iaNo5RY.jpg","certification":"N/A","genres":["Documentário"],"trailer":"VEzpz84M3Y0"},
