"14745":{"id":"14745","name":"Jovens Malditos","slug":"jovens-malditos","original_title":"The Haunting of Molly Hartley","overview":"Molly Hartley está decidida a deixar para trás todos os problemas do passado assim que começa a estudar numa nova escola. É um ótimo começo, principalmente porque ela inicia um romance com o rapaz mais popular do local. Mas a tensão e o medo novamente tomam conta de Molly. Ela tem dúvidas se conseguirá manter seus segredos enterrados, sobretudo quando ela começa a descobrir terríveis acontecimentos que a esperam quando ela está prestes a comemorar seus 18 anos de idade.","first_air_date":"2008-10-31","runtime":82,"episode_run_time":[82],"vote_average":4.3,"created_by":["LD Entertainment","Huntington Prep"],"production_companies":[{"name":"LD Entertainment"},{"name":"Huntington Prep"}],"cast":["Haley Bennett","Jake Weber","Chace Crawford","Shannon Woodward","Shanna Collins"],"backdrop_path":"https://image.tmdb.org/t/p/original/qK4akU35K67XyaZd9LhsnuWaEgN.jpg","poster_path":"https://image.tmdb.org/t/p/original/XSy8BKHIa19yMAt7XyO2s9oIT5.jpg","certification":"N/A","genres":["Drama","Terror"],"trailer":"N/A"},
"460024":{"id":"460024","name":"Paralisia","slug":"paralisia","original_title":"Stasis","overview":"Ava ingere pílulas e álcool em uma noite de festa, vindo a passar mal e desmaiar. Desperta solitariamente e se dirige para casa. Porém ao deparar consigo deitada em sua cama, descobre que alguém apossou-se de seu corpo. Um viajante temporal está usurpando sua identidade e sua vida. Além disso não está sozinho, pois existem outros vivendo no presente para alterar o futuro. Sem o próprio corpo, Ava é um fantasma virtual, silencioso e invisível para o mundo. E diante das barreiras do impossível, ela sabe que é a única que pode conter os viajantes e colocar a linha temporal em seu curso.","first_air_date":"2017-06-02","runtime":84,"episode_run_time":[84],"vote_average":3.6,"created_by":["Vangard Productions","PraxiScope Productions"],"production_companies":[{"name":"Vangard Productions"},{"name":"PraxiScope Productions"}],"cast":["Anna Harr","Mark Grossman","Phyllis Spielman","Tiana Masaniai","Caleb Thomas"],"backdrop_path":"https://image.tmdb.org/t/p/original/r8iAdcutxYp8tnSWa69QlxD0cZ0.jpg","poster_path":"https://image.tmdb.org/t/p/original/g0AgiPF1qBObVDLK7pwncujVpuo.jpg","certification":"N/A","genres":["Aventura","Ficção científica"],"trailer":"N/A"},
