"934323":{"id":"934323","name":"Mickey: A História de um Camundongo","slug":"mickey-a-historia-de-um-camundongo","original_title":"Mickey: The Story of a Mouse","overview":"Um dos ícones mais amados do mundo, Mickey Mouse é reconhecido como símbolo de alegria e inocência infantil em praticamente todo o planeta. Produto da imaginação de Walt Disney em um momento difícil de sua carreira que logo floresceria, Mickey se tornou uma sensação da noite para o dia depois de estrelar seu primeiro curta-metragem de animação com som sincronizado, o Steamboat Willie. Ao longo das décadas, ele se transformou e teve versões extremamente diferentes e que refletem tanto a carreira espetacular do seu criador quanto as dramáticas mudanças sociais do país que ele veio a representar.","first_air_date":"2022-03-19","runtime":93,"episode_run_time":[93],"vote_average":7.0,"created_by":["Tremolo Productions","ABC News Studios"],"production_companies":[{"name":"Tremolo Productions"},{"name":"ABC News Studios"}],"cast":["Floyd Norman","Carmenita Higginbotham","Eric Goldberg","Mark Henn","Randy Haycock"],"backdrop_path":"https://image.tmdb.org/t/p/original/sTQw7EpiMtyFOopwTLV7DjsNbOx.jpg","poster_path":"https://image.tmdb.org/t/p/original/ryZX7DPAl2Wv5LMR4JsBJUy5RPr.jpg","certification":"10","genres":["Documentário"],"trailer":"zEdKjM6RVHc"},
