"33081":{"id":"33081","name":"Paheli","slug":"paheli","original_title":"पहेली","overview":"Um fantasma se apaixona perdidamente por uma mulher recém-casada. Quando o marido dela é obrigado a se ausentar por cinco anos a trabalho, o fantasma assume as feições do rapaz e procura pela jovem. Ele conta toda a verdade, mas incrivelmente a mulher aceita o fantasminha. Anos depois o marido verdadeiro retorna e a confusão se arma quando ninguém entende duas pessoas exatamente iguais. Baseado numa história do folclore indiano, por sua vez adaptada do romance de Vijayadan Detha.","first_air_date":"2005-06-24","runtime":141,"episode_run_time":[141],"vote_average":6.2,"created_by":["Red Chillies Entertainment"],"production_companies":[{"name":"Red Chillies Entertainment"}],"cast":["शाहरुख़ ख़ान","Rani Mukerji","Anupam Kher","Aditi Gowitrikar","Rajpal Yadav"],"backdrop_path":"https://image.tmdb.org/t/p/original/7WoyOMp0wORdgYJimHeg0XuNaTM.jpg","poster_path":"https://image.tmdb.org/t/p/original/oISF8nJF4KZ5zFFJCXoPu2Gnedd.jpg","certification":"N/A","genres":["Romance","Drama","Fantasia"],"trailer":"N/A"},
