"31000":{"id":"31000","name":"Não Chame a Polícia!","slug":"nao-chame-a-policia","original_title":"Amos & Andrew","overview":"A confusão começa quando um rico e famoso escritor negro compra uma mansão e, em plena mudança, é confundido com um assaltante. Os vizinhos chamam a polícia, que já vem em ponto de bala e arma a maior encrenca. O oficial Tolliver percebendo que Andrew (Samuel L. Jackson) não é um ladrão e sim o dono da casa, tenta remediar a situação e põe Amos (Nicolas Cage),um grande vigarista, na jogada. Só que ele complica ainda mais o caso.","first_air_date":"1993-03-05","runtime":96,"episode_run_time":[96],"vote_average":5.4,"created_by":["New Line Cinema","Castle Rock Entertainment","Columbia Pictures"],"production_companies":[{"name":"New Line Cinema"},{"name":"Castle Rock Entertainment"},{"name":"Columbia Pictures"}],"cast":["Samuel L. Jackson","Nicolas Cage","Michael Lerner","Margaret Colin","Dabney Coleman"],"backdrop_path":"https://image.tmdb.org/t/p/original/s3g59fRvsz37PFEYxy11GAmTghN.jpg","poster_path":"https://image.tmdb.org/t/p/original/IdhtO8iqvmyEJtcjThthZPOiaV.jpg","certification":"N/A","genres":["Ação","Comédia"],"trailer":"N/A"},
"209361":{"id":"209361","name":"Apenas uma Chance","slug":"apenas-uma-chance","original_title":"One Chance","overview":"A incrível história de Paul Potts (James Corden), tímido vendedor que surpreendeu o Reino Unido ao interpretar impecavelmente uma ária de ópera no programa Britain's Got Talent. O vídeo de sua primeira apresentação somou milhões de visualizações no Youtube e o cantor tornou-se uma estrela do dia para a noite.","first_air_date":"2013-09-09","runtime":103,"episode_run_time":[103],"vote_average":6.7,"created_by":["Relevant Entertainment","Syco Television","Weston Pictures","The Weinstein Company"],"production_companies":[{"name":"Relevant Entertainment"},{"name":"Syco Television"},{"name":"Weston Pictures"},{"name":"The Weinstein Company"}],"cast":["James Corden","Alexandra Roach","Julie Walters","Colm Meaney","Jemima Rooper"],"backdrop_path":"https://image.tmdb.org/t/p/original/o8QeIgs4CVNjFDZuAzXE1OIEuZ4.jpg","poster_path":"https://image.tmdb.org/t/p/original/5djprMW1NpRliuU11W1uMjxiqpC.jpg","certification":"12","genres":["Drama","Comédia","Música"],"trailer":"N/A"},
"32395":{"id":"32395","name":"Em Busca de uma Nova Chance","slug":"em-busca-de-uma-nova-chance","original_title":"The Greatest","overview":"No último dia de aula, Rose enfim consegue conversar com Bennett, que a paquera desde o primeiro dia. Eles iniciam um romance arrebatador, onde um é o que o outro sempre sonhou. Só que, logo após terem sua primeira noite de amor, um caminhão atinge o carro em que estão. O acidente mata Bennett, o que coloca seus pais, Allen e Grace, além do irmão Ryan, em choque. Três meses depois, Rose bate à porta da família Brewer para avisá-los que está grávida de Bennett.","first_air_date":"2009-02-07","runtime":99,"episode_run_time":[99],"vote_average":6.2,"created_by":["Barbarian Films","Oceana Media Finance","Silverwood Films","Irish Dreamtime"],"production_companies":[{"name":"Barbarian Films"},{"name":"Oceana Media Finance"},{"name":"Silverwood Films"},{"name":"Irish Dreamtime"}],"cast":["Pierce Brosnan","Susan Sarandon","Carey Mulligan","Aaron Taylor-Johnson","Johnny Simmons"],"backdrop_path":"https://image.tmdb.org/t/p/original/fQehemJNDIKfGcmTnvm5SqQ7kgr.jpg","poster_path":"https://image.tmdb.org/t/p/original/6Z5EcCAedcNUvGq23FTwD9GoLMb.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"11058":{"id":"11058","name":"O Enviado","slug":"o-enviado","original_title":"Godsend","overview":"Adam, o filho de oito anos de Jessie e Paul, morre num acidente no dia de seu aniversário. Logo depois o casal conhece Richard, um doutor renomado da pesquisa genética, que ao saber do caso, resolve ajudá-los. Ele propõe ao casal que eles participem de uma experiência de clonagem. Depois de muito pensar, eles aceitam e a experiência que dá certo. Adam \"renasce\" igualzinho, mas só até completar oito anos. A partir de então, uma nova personalidade começa a se manifestar em Adam... Sinistra e aterrorizante!","first_air_date":"2004-04-30","runtime":102,"episode_run_time":[102],"vote_average":4.9,"created_by":["Blue Productions","Lions Gate Films","Artists Production Group","2929 Productions"],"production_companies":[{"name":"Blue Productions"},{"name":"Lions Gate Films"},{"name":"Artists Production Group"},{"name":"2929 Productions"}],"cast":["Greg Kinnear","Rebecca Romijn","Robert De Niro","Cameron Bright","Zoie Palmer"],"backdrop_path":"https://image.tmdb.org/t/p/original/eDcuAU8mpjRYXOMtDGUYx7Y0tVR.jpg","poster_path":"https://image.tmdb.org/t/p/original/573orA06nQNNVTIUceNgQdGGc62.jpg","certification":"N/A","genres":["Drama","Terror","Ficção científica","Thriller"],"trailer":"N/A"},
"244517":{"id":"244517","name":"O Mistério de God’s Pocket","slug":"o-misterio-de-god-s-pocket","original_title":"God's Pocket","overview":"No bairro operário de God’s Pocket, o louco enteado de Mickey Scarpato (Philip Seymour Hoffman) é morto num acidente em uma construção. Ele rapidamente tenta enterrar o corpo para se livrar do problema, mas um jornalista local começa a procurar a verdade por trás dos fatos, tornando tudo ainda pior. Mickey encontra-se, então, numa situação complicada, com um corpo que não pode enterrar, uma mulher que não consegue agradar e uma dívida que não pode pagar.","first_air_date":"2014-05-09","runtime":88,"episode_run_time":[88],"vote_average":5.8,"created_by":["Shoestring Pictures","Park Pictures Features","Cooper's Town"],"production_companies":[{"name":"Shoestring Pictures"},{"name":"Park Pictures Features"},{"name":"Cooper's Town"}],"cast":["Philip Seymour Hoffman","Richard Jenkins","Christina Hendricks","John Turturro","Eddie Marsan"],"backdrop_path":"https://image.tmdb.org/t/p/original/kncNEWenrMU3o53kMcPr4pGuI7p.jpg","poster_path":"https://image.tmdb.org/t/p/original/azFv1ribl8bW0i9bU2DricoaHnd.jpg","certification":"16","genres":["Drama"],"trailer":"N/A"},
"8060":{"id":"8060","name":"Vida de Casado","slug":"vida-de-casado","original_title":"Married Life","overview":"Depois de três décadas de um casamento feliz, Harry (Chris Cooper) decide que deve matar sua mulher Pat (Patricia Clarkson) porque a ama demais para permitir que ela sofra quando ele a abandonar, já que está apaixonado pela jovem Kay (Rachel McAdams) que por sua vez, é cortejada pelo melhor amigo de Harry, Richard (Pierce Brosman). Enquanto Harry prepara seu plano de assassinato, os outros personagens estão ocupados com suas próprias traições. Como Harry, se deixam levar por suas paixões que, por sua vez, chocam-se com sua moralidade, bem intencionada porém desonesta ao mesmo tempo.","first_air_date":"2008-03-28","runtime":90,"episode_run_time":[90],"vote_average":5.7,"created_by":["Sidney Kimmel Entertainment","Anonymous Content","Firm Films"],"production_companies":[{"name":"Sidney Kimmel Entertainment"},{"name":"Anonymous Content"},{"name":"Firm Films"}],"cast":["Pierce Brosnan","Chris Cooper","Patricia Clarkson","Rachel McAdams","David Wenham"],"backdrop_path":"https://image.tmdb.org/t/p/original/fvIj8fo9j6DifyMWopHevGVhFUQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/7G4yQtSE5IMFAw5cX9Bqxvue7sl.jpg","certification":"N/A","genres":["Crime","Drama","Romance"],"trailer":"N/A"},
