"491037":{"id":"491037","name":"O Efeito Mandela","slug":"o-efeito-mandela","original_title":"The Mandela Effect","overview":"O Efeito Mandela, um termo cunhado de instâncias em que muitos certamente lembrariam algo de um jeito particular, mas resulta ser incorreto, segue um homem que fica obcecado com fatos e eventos que coletivamente foram lembrados por milhares de pessoas. Acreditando que o fenômeno é o sintoma de algo muito maior, sua obsessão eventualmente o leva a questionar a própria realidade.","first_air_date":"2019-12-06","runtime":79,"episode_run_time":[79],"vote_average":6.4,"created_by":["Periscope Entertainment"],"production_companies":[{"name":"Periscope Entertainment"}],"cast":["Charlie Hofheimer","Aleksa Palladino","Robin Lord Taylor","Clarke Peters","Madeleine McGraw"],"backdrop_path":"https://image.tmdb.org/t/p/original/dDkoL4k5QTvE5MX2yuuSb5WDix4.jpg","poster_path":"https://image.tmdb.org/t/p/original/lfNHN7octVCixn38Vu2iQ0klQCg.jpg","certification":"N/A","genres":["Ficção científica","Thriller","Drama"],"trailer":"N/A"},
