"400020":{"id":"400020","name":"O Jovem Karl Marx","slug":"o-jovem-karl-marx","original_title":"Le Jeune Karl Marx","overview":"Karl Marx, de 26 anos, embarca com sua esposa, Jenny, na estrada para o exílio. Em 1844, em Paris, ele conhece Friedrich Engels, filho de um industrial, que investigou o sórdido nascimento da classe trabalhadora britânica. Engels, o dândi, fornece a última parte do quebra-cabeça para a nova visão do mundo do jovem Karl Marx. Juntos, entre a censura e a repressão da polícia, os tumultos e os conflitos políticos, eles liderarão o movimento trabalhista durante seu desenvolvimento em uma era moderna.","first_air_date":"2017-03-02","runtime":118,"episode_run_time":[118],"vote_average":6.8,"created_by":["Rohfilm","Velvet Film","Artémis Productions","Agat Films & Cie / Ex Nihilo"],"production_companies":[{"name":"Rohfilm"},{"name":"Velvet Film"},{"name":"Artémis Productions"},{"name":"Agat Films & Cie / Ex Nihilo"}],"cast":["August Diehl","Stefan Konarske","Vicky Krieps","Olivier Gourmet","Hannah Steele"],"backdrop_path":"https://image.tmdb.org/t/p/original/uJSuJ4eocpofYc6LjEJ7G3vgbfS.jpg","poster_path":"https://image.tmdb.org/t/p/original/1Iry9zkbgyeIzvwaZY1jFtMpZRg.jpg","certification":"14","genres":["História","Drama"],"trailer":"VHAYjRnc91E"},
