"5172":{"id":"5172","name":"Sonhando Alto","slug":"sonhando-alto","original_title":"The Astronaut Farmer","overview":"Após seu pai falecer, Charles Farmer (Billy Bob Thornton), um astronauta da Nasa, é forçado a se aposentar para cuidar da fazenda da família. Entretanto Charles se recusa a desistir de seu sonho de viajar pelo espaço e começa a construir seu próprio foguete, mesmo sofrendo ameaças do governo.","first_air_date":"2007-02-23","runtime":104,"episode_run_time":[104],"vote_average":6.2,"created_by":["Polish Brothers Construction","Warner Bros. Pictures"],"production_companies":[{"name":"Polish Brothers Construction"},{"name":"Warner Bros. Pictures"}],"cast":["Billy Bob Thornton","Virginia Madsen","Max Thieriot","Jasper Polish","Logan Polish"],"backdrop_path":"https://image.tmdb.org/t/p/original/l4hWbdxXompHvLIR0bl3m3WromI.jpg","poster_path":"https://image.tmdb.org/t/p/original/19uGc8wW3Ert1QvMYxvnReQkFMc.jpg","certification":"N/A","genres":["Ficção científica","Aventura","Comédia","Drama"],"trailer":"N/A"},
"6473":{"id":"6473","name":"O Atirador: Apontando para a Morte","slug":"o-atirador-apontando-para-a-morte","original_title":"The Marksman","overview":"Com a Rússia à beira da aniquilação nuclear, existe somente um homem que pode salvar o país: O Atirador. Como soldado de elite das forças especiais norte-americanas, ele recebeu ordens para retirar uma planta de usina nuclear da Chechênia antes que terroristas ativem um reator nuclear. Ao se infiltrar no bem guardado local, O Atirador indica o alvo para que um míssil norte-americano o atinja e foge em seguida. Mas quando ele descobre que são os mísseis, e não os terroristas, que acionarão o dispositivo, O Atirador percebe que foi enganado. Ele, então, inicia uma corrida contra o tempo na tentativa de desarmar o alvo cuja detonação pode causar a morte de milhares de pessoas e arruinar duas potências mundiais.","first_air_date":"2005-09-06","runtime":95,"episode_run_time":[95],"vote_average":5.4,"created_by":["Andrew Stevens Entertainment","Castel Film"],"production_companies":[{"name":"Andrew Stevens Entertainment"},{"name":"Castel Film"}],"cast":["Wesley Snipes","Emma Samms","William Hope","Anthony Warren","Peter Youngblood Hills"],"backdrop_path":"https://image.tmdb.org/t/p/original/v9AlJeQ1hLywJZux8i9mH84vPRH.jpg","poster_path":"https://image.tmdb.org/t/p/original/6FUeLOsqxJRHBGQ3SExaaz1yIOf.jpg","certification":"N/A","genres":["Ação","Aventura","Thriller"],"trailer":"N/A"},
"535265":{"id":"535265","name":"Assassinos Anônimos","slug":"assassinos-anonimos","original_title":"Killers Anonymous","overview":"A tensão está insuportável dentro do Assassinos Anônimos, um grupo de apoio para matadores, quando todos estão tentando descobrir qual deles está por trás de um atentado contra um importante senador – crime que colocou toda a polícia da cidade em alerta. Só que a trama é bem mais complexa do que um simples assassinato encomendado e, conforme os segredos vão sendo revelados, uma conspiração envolvendo alianças secretas e traições, tornando a sessão de hoje uma explosão de violência e caos. Agora, é matar ou morrer… Entre assassinos!","first_air_date":"2019-06-27","runtime":95,"episode_run_time":[95],"vote_average":4.7,"created_by":["Posterity Pictures","Goldfinch"],"production_companies":[{"name":"Posterity Pictures"},{"name":"Goldfinch"}],"cast":["Tommy Flanagan","Jessica Alba","Gary Oldman","Rhyon Nicole Brown","MyAnna Buring"],"backdrop_path":"https://image.tmdb.org/t/p/original/ahNBewkTuhp1ckP42MkKSit0ajX.jpg","poster_path":"https://image.tmdb.org/t/p/original/hbdxIUT0S6kqlFXnhG79BNNggcA.jpg","certification":"16","genres":["Ação","Thriller","Crime","Mistério"],"trailer":"N/A"},
"307226":{"id":"307226","name":"Carrossel: O Filme","slug":"carrossel-o-filme","original_title":"Carrossel: O Filme","overview":"A turma de \"Carrossel\" está de férias da Escola Mundial e os amigos se reúnem no acampamento Panapaná, onde embarcam em novas aventuras. Juntos, eles viverão dias incríveis, participando de brincadeiras organizadas pelo senhor Campos, um velhinho muito simpático, que faz de tudo para que as crianças se divirtam ao máximo. Enquanto as crianças se divertem, Gonzáles, funcionário de uma incorporadora, aparece no acampamento com a missão de comprar o terreno para transformá-lo em uma fábrica poluidora. O vilão procura sabotar o Panapaná para obrigar o senhor Campos a fechá-lo, mas a esperta turma da Escola Mundial se une para atrapalhar seus planos e manter o acampamento em funcionamento.","first_air_date":"2015-07-23","runtime":80,"episode_run_time":[80],"vote_average":7.3,"created_by":["SBT","RioFilme","Televisa","Paris Entretenimento","SBT Filmes"],"production_companies":[{"name":"SBT"},{"name":"RioFilme"},{"name":"Televisa"},{"name":"Paris Entretenimento"},{"name":"SBT Filmes"}],"cast":["Larissa Manoela","Jean Paulo Campos","Maisa Silva","Guilherme Seta","Nicholas Torres"],"backdrop_path":"https://image.tmdb.org/t/p/original/1BQ7oXmxA7Zmef3ChZPXEwWhnNG.jpg","poster_path":"https://image.tmdb.org/t/p/original/7mFT1RnjzI83o65kh6NRsg2P8V8.jpg","certification":"L","genres":["Comédia","Família"],"trailer":"geVEWfDElDA"},
"79382":{"id":"79382","name":"O Que Eu Mais Desejo","slug":"o-que-eu-mais-desejo","original_title":"奇跡","overview":"Dois irmãos se afastam após a separação dos pais. O mais velho vive com a mãe e o outro com o pai, mas enquanto o primeiro sonha que a família viva toda junta novamente, o outro não quer isso em hipótese nenhuma. A chegada do trem-bala na região é acompanhada de um mito entre as crianças de que no encontro de dois trens existe uma liberação de energia grande o suficiente para realizar um desejo, e o irmão mais velho planeja uma viagem secreta para encontrar-se com o mais novo em uma cidade onde o encontro dos trens é provável para pedir que a família fique junta novamente.","first_air_date":"2011-06-11","runtime":127,"episode_run_time":[127],"vote_average":7.3,"created_by":["Chugoku Broadcasting (RCC)","jeki"],"production_companies":[{"name":"Chugoku Broadcasting (RCC)"},{"name":"jeki"}],"cast":["前田航基","前田旺志郎","大塚寧々","オダギリジョー","林凌雅"],"backdrop_path":"https://image.tmdb.org/t/p/original/oRqDdcxBvAWIBGq3z8wN6uOFNEZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/bjcrJ8twu4ZT2rgQ3SUO4Vqt0CN.jpg","certification":"L","genres":["Drama"],"trailer":"N/A"},
