"100542":{"id":"100542","name":"Vikingdom: O Reino Viking","slug":"vikingdom-o-reino-viking","original_title":"Vikingdom","overview":"Envolto no tempo, surge o retinir do aço contra o aço, o choque entre o mito e a história… O Reino Viking. Baseada nas lendas nórdicas e nos poemas épicos que os vikings deixaram para trás, esta é uma aventura de ação e fantasia sobre um rei esquecido, Eirick, que foi incumbido da impossível missão de derrotar Thor, o Deus do Trovão. Buscando reunir relíquias antigas, Thor vai usá-las com seu martelo durante o Eclipse de Sangue para conquistar os três reinos e dominar toda a humanidade. Somente um homem pode detê-lo… Eirick, o Sanguinário Eirick, o Morto-Vivo.","first_air_date":"2013-09-11","runtime":114,"episode_run_time":[114],"vote_average":4.1,"created_by":["KRU Studios"],"production_companies":[{"name":"KRU Studios"}],"cast":["Dominic Purcell","Natassia Malthe","Craig Fairbrass","Conan Stevens","Jesse Moss"],"backdrop_path":"https://image.tmdb.org/t/p/original/7lK2cM9zotTi3pqX5LHe2u9IY1E.jpg","poster_path":"https://image.tmdb.org/t/p/original/bnAPrrfgkSF10hvR5YsE0uzm3Ew.jpg","certification":"N/A","genres":["Aventura"],"trailer":"N/A"},
