"1224953":{"id":"1224953","name":"Jornada do Herói: Os Bastidores do Percy Jackson e os Olimpianos","slug":"jornada-do-heroi-os-bastidores-do-percy-jackson-e-os-olimpianos","original_title":"A Hero's Journey: The Making of Percy Jackson and the Olympians","overview":"Ser um semideus não é fácil... e ocupar o lugar de personagens queridos também não. Enquanto interpretam personagens em uma missão, Walker, Leah e Aryan embarcam em sua própria aventura. Acompanhe esta turma entusiasmada de três jovens heróis enquanto exploram os mundos grandiosos de deuses, lutam contra criaturas inesquecíveis e realizam cenas de ação lendárias. Tudo isso enquanto ainda vão à escola.","first_air_date":"2024-01-30","runtime":51,"episode_run_time":[51],"vote_average":6.4,"created_by":["Evolve Studios"],"production_companies":[{"name":"Evolve Studios"}],"cast":["Walker Scobell","Leah Sava Jeffries","Aryan Simhadri","Rick Riordan","Dan Shotz"],"backdrop_path":"https://image.tmdb.org/t/p/original/1U1xK1qYUqiTEJfuizZJYWPFzfA.jpg","poster_path":"https://image.tmdb.org/t/p/original/lc9Glu7gK0HgLS4FZRoR4rH6Rob.jpg","certification":"10","genres":["Documentário"],"trailer":"N/A"},
