"3515":{"id":"3515","name":"Vingança Final","slug":"vinganca-final","original_title":"I'll Sleep When I'm Dead","overview":"Após uma crise nervosa o gângster londrino Will Graham (Clive Owen) largou a \"profissão\" e se mudou para o campo. Paralelamente o irmão mais novo dele, Davey (Jonathan Rhys Meyers), aproveita a vida sendo um mulherengo e se sustenta fazendo tráfico de drogas. Mas numa noite tudo isto muda, pois um homem mais velho, Boad (Malcolm McDowell), o sodomiza com a ajuda de dois cúmplices. O traumatizado Davey volta para casa e comete suicídio. Will fica sabendo da morte do irmão e tenta juntar as peças sobre o ocorrido.","first_air_date":"2003-05-14","runtime":103,"episode_run_time":[103],"vote_average":5.4,"created_by":["Samaha Productions","Will & Company","Revere Pictures","Seven Arts Films","Lagoon Entertainment"],"production_companies":[{"name":"Samaha Productions"},{"name":"Will & Company"},{"name":"Revere Pictures"},{"name":"Seven Arts Films"},{"name":"Lagoon Entertainment"}],"cast":["Clive Owen","Jonathan Rhys Meyers","Charlotte Rampling","Malcolm McDowell","Jamie Foreman"],"backdrop_path":"https://image.tmdb.org/t/p/original/ayTQ3hMnyv4yawGMSVwfBy5teg9.jpg","poster_path":"https://image.tmdb.org/t/p/original/tqlthKFb0aL7GCXJgltnzFJebcw.jpg","certification":"N/A","genres":["Drama","Ação","Thriller","Crime"],"trailer":"N/A"},
"28410":{"id":"28410","name":"Tuff Turf: O Rebelde","slug":"tuff-turf-o-rebelde","original_title":"Tuff Turf","overview":"Prestes a terminar o terceiro ano do segundo grau, Morgan se vê obrigado a mudar de estilo de vida passando a freqüentar os subúrbios da cidade onde vive, ao invés do clube de garotos ricos. Ao contrário da boa reputação de seu irmão mais velho, Morgan já tem um histórico de problemas e é conhecido por sua cabeça quente. Em sua nova escola, Morgan acaba se envolvendo com a namorada do líder da gangue. O delinquente ameaça Morgan que mesmo sabendo do risco que está correndo não vai desistir desse relacionamento. Só resta saber se essa turma vai deixar que o novo mauricinho na área leve a melhor.","first_air_date":"1985-01-11","runtime":112,"episode_run_time":[112],"vote_average":5.9,"created_by":["Planet Productions","New World Pictures","New World Production"],"production_companies":[{"name":"Planet Productions"},{"name":"New World Pictures"},{"name":"New World Production"}],"cast":["James Spader","Kim Richards","Paul Mones","Matt Clark","Claudette Nevins"],"backdrop_path":"https://image.tmdb.org/t/p/original/3tcOiIKJtEfqW01TDXgltf4Pf76.jpg","poster_path":"https://image.tmdb.org/t/p/original/p2gYbCdLu34JxtnPVGGmX07yb1a.jpg","certification":"N/A","genres":["Drama","Ação","Romance"],"trailer":"N/A"},
"492414":{"id":"492414","name":"Experimentos Macabros","slug":"experimentos-macabros","original_title":"Alive","overview":"Um homem e uma mulher acordam após uma cirurgia em um sanatório abandonado, sem nenhuma lembrança de quem são ou de como chegaram lá. Mas eles rapidamente descobrem que não estão sozinhos. Um médico enlouquecido afirma ser sua única chance de recuperação, mas o tratamento bizarro e as refeições de revirar o estômago a que os submete não passam de uma sádica brincadeira. E o pior de tudo é que apenas o médico sabe como libertá-los e tem as respostas horríveis sobre a verdadeira identidade deles.","first_air_date":"2018-09-07","runtime":91,"episode_run_time":[91],"vote_average":6.0,"created_by":["775 Media Corp","Cranked Up Films"],"production_companies":[{"name":"775 Media Corp"},{"name":"Cranked Up Films"}],"cast":["Thomas Cocquerel","Camille Stopps","Angus Macfadyen","Chantal Perron","Gerrick Winston"],"backdrop_path":"https://image.tmdb.org/t/p/original/fsXRK8Y4f3a4JAvx0x0rNRleR2R.jpg","poster_path":"https://image.tmdb.org/t/p/original/lWEDkpnzjHRwIl8JP14W5LlO2KG.jpg","certification":"16","genres":["Terror","Thriller"],"trailer":"N/A"},
