"13255":{"id":"13255","name":"Conspiração","slug":"conspiracao","original_title":"Conspiracy","overview":"Val Kilmer, Jennifer Esposito e Gary Cole protagonizam este filme explosivo e carregado de ação sobre um ex-fuzileiro da marinha americana que traz justiça a uma pequena localidade. Ferido em combate no Iraque, MacPherson (Kilmer) aceita, sem grande vontade, juntar-se a um ex-colega de combate no seu rancho do Arizona. Ao chegar, porém, MacPherson depara-se com o misterioso desaparecimento do amigo e com o facto de ninguém admitir conhecê-lo. Ao descobrir que uma associação está a expulsar imigrantes ilegais da cidade sem olhar a meios, MacPherson decide descobrir toda a verdade e não parar diante nada para castigar todos os envolvidos.","first_air_date":"2008-02-15","runtime":90,"episode_run_time":[90],"vote_average":5.5,"created_by":["Hollywood Media Bridge","Stage 6 Films"],"production_companies":[{"name":"Hollywood Media Bridge"},{"name":"Stage 6 Films"}],"cast":["Val Kilmer","Jennifer Esposito","Gary Cole","Alesia Riabenkova","Jay Jablonski"],"backdrop_path":"https://image.tmdb.org/t/p/original/y5g9mSbOpwX9gQk7LG4Lysfh7kA.jpg","poster_path":"https://image.tmdb.org/t/p/original/eo7KGk5qJyrpQtimmkNyfz4kllI.jpg","certification":"N/A","genres":["Drama","Ação","Thriller","Mistério"],"trailer":"N/A"},
"587609":{"id":"587609","name":"Caros Camaradas! Trabalhadores em Luta","slug":"caros-camaradas-trabalhadores-em-luta","original_title":"Дорогие товарищи!","overview":"Lyudmila é uma executiva e devota do Partido Comunista, que lutou na Segunda Guerra Mundial pela ideologia de Stalin. Certa de que seu trabalho criará uma sociedade comunista, a mulher detesta qualquer sentimento antissoviético. Durante uma greve, Lyudmila testemunhou trabalhadores sendo baleados por ordem do governo, que busca encobrir greves trabalhistas em massa. Após o banho de sangue, quando os sobreviventes fogem da praça, Lyudmila percebe que sua filha desapareceu. Uma fenda aberta se abre em sua visão de mundo.","first_air_date":"2020-09-14","runtime":120,"episode_run_time":[120],"vote_average":7.3,"created_by":["Production Center of Andrei Konchalovsky","Russia-1"],"production_companies":[{"name":"Production Center of Andrei Konchalovsky"},{"name":"Russia-1"}],"cast":["Юлия Высоцкая","Sergei Erlish","Yulia Burova","Андрей Гусев","Владислав Комаров"],"backdrop_path":"https://image.tmdb.org/t/p/original/kQjoo1BCMaItNOrLxZU3g5X75NC.jpg","poster_path":"https://image.tmdb.org/t/p/original/5RKhxGelSNXxbGf96Ul8nbDpFbT.jpg","certification":"14","genres":["História","Drama"],"trailer":"ffLDiiCipMU"},
