"37932":{"id":"37932","name":"Flicka 2","slug":"flicka-2","original_title":"Flicka 2","overview":"Carrie é uma adolescente da cidade grande cuja vida é virada de cabeça para baixo quando ela se muda para um rancho em Wyoming para morar com o pai. Mas tudo muda quando Carrie conhece Flicka, um selvagem e negro mustang que é tão livre e forte quanto Carrie. Os dois formam um vínculo especial e Carrie abre seu coração para seu pai e um belo garoto local, mas quando um rival ciumento coloca a vida de Flicka em perigo, Carrie deve fazer o que for preciso para salvar sua melhor amiga.","first_air_date":"2010-05-04","runtime":94,"episode_run_time":[94],"vote_average":6.7,"created_by":["20th Century Fox Home Entertainment"],"production_companies":[{"name":"20th Century Fox Home Entertainment"}],"cast":["Patrick Warburton","Tammin Sursok","Emily Tennant","Reilly Dolman","Clint Black"],"backdrop_path":"https://image.tmdb.org/t/p/original/qJ1TKRNpajzufU7nXNcaSAnR6aC.jpg","poster_path":"https://image.tmdb.org/t/p/original/arHrxRFzIx06eYhijR5SmrRU6gG.jpg","certification":"N/A","genres":["Família","Drama"],"trailer":"N/A"},
"59883":{"id":"59883","name":"A Era dos Dragões","slug":"a-era-dos-dragoes","original_title":"Age of the Dragons","overview":"O ambiente é hostil, o céu é um cruel inimigo e predadores alados amedrontam a face da Terra, cuspindo fogo. Em meio a neve e a neblina, um pequeno grupo de aventureiros e caçadores embarca em uma incrível jornada liderada por um capitão atormentado e obcecado por vingar-se do maior dos dragões. Enquanto lutam para continuarem vivos em terras distantes e ameaçados o tempo todo por essas criaturas impiedosas, eles estreitam laços e descobrem que o passado pode aproximá-los ou dividi-los.","first_air_date":"2011-03-21","runtime":91,"episode_run_time":[91],"vote_average":4.0,"created_by":[],"production_companies":[],"cast":["Corey Sevier","Danny Glover","Vinnie Jones","Sofia Pernas","Larry Bagby"],"backdrop_path":"https://image.tmdb.org/t/p/original/wQ8aTPeKYVoV6oMrNriN2GM7uhR.jpg","poster_path":"https://image.tmdb.org/t/p/original/dw5wraNaujH69dxdFTIslErL0nO.jpg","certification":"N/A","genres":["Aventura","Ação","Fantasia"],"trailer":"6FRRXd4e6es"},
"653569":{"id":"653569","name":"Salve-Se Quem Puder!","slug":"salve-se-quem-puder","original_title":"Save Yourselves!","overview":"Jack e Su são um casal moderno do Brooklyn que, como muitos de seus amigos, se vê dependente da tecnologia e incapaz de desligar o telefone. Temendo que esse vício estúpido possa afetar a conexão um com o outro, eles aproveitam a chance de seguir para uma cabana isolada na floresta, prometendo se desconectar do mundo exterior por uma semana. Protegidos de mensagens de texto e notificações por push, eles ignoram alegremente quando alienígenas atacam a Terra. À medida que eventos estranhos se desenrolam, o casal deve descobrir um caminho de volta à civilização - ou o que resta dela.","first_air_date":"2020-10-02","runtime":93,"episode_run_time":[93],"vote_average":5.8,"created_by":["Washington Square Films"],"production_companies":[{"name":"Washington Square Films"}],"cast":["Sunita Mani","John Reynolds","Ben Sinclair","John Early","Jo Firestone"],"backdrop_path":"https://image.tmdb.org/t/p/original/2vJewgdaf0N8BnAgHZ8R7y3w5qQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/j3pW7MdAhFwDejNbMeJj0GOXusQ.jpg","certification":"18","genres":["Comédia","Ficção científica"],"trailer":"N/A"},
